import React from 'react';
import Navbar from './components/Navbar';
import Hero from './components/Hero/Hero';
import Services from './components/Services';

function App() {
  return (
    <div className="min-h-screen bg-dark grid-bg">
      <Navbar />
      <Hero />
      <Services />
    </div>
  );
}

export default App;
